export const useStyles = makeStyles({
  peoples:{
    display:"flex",
    '& div:first-child':{
      marginBottom:62
    }
  },
  firstColumn:{
    marginRight:149,
  },
  group:{
    display:'flex',
    marginTop:150
  },
  '@media(max-width:1200px)':{
    group:{
      display:"block"
    }
  }
})
